flashback Just a fun post today taking a break from all the heady things for a moment. Well kind of.  Found this photo from the Children's Uniting Nations and Amnesty International Oscar event a few years ago. Okay, so I get the goodwill in sponsors such as American Express . It is great when brands support initiatives - however!

 I noticed a few weeks ago that American Express was popping up around my name and logo online on social media-a lot- so I have been advertising Amex but not - as they have not contact me to pay a fee! In the traditional days we used to get paid well by brands... for commercial media use - so American Express please contact me and my reps and I would love to formalize  a deal. I am an Amex Card holder
